// Header.js
import React from 'react';
import './Header.css';
import logo from './images/logo.png'; // Update this path to your logo image

const Header = () => {
  return (
    <header className="header">
      <div className="header-content">
        <div className="logo-container">
          <img src={logo} alt="Logo" className="logo" />
          <h1 className="header-title">Sports Central</h1>
        </div>
        <nav className="navbar">
          <ul className="nav-list">
            <li className="nav-item"><a href="#home" className="nav-link">Home</a></li>
            <li className="nav-item"><a href="#trending" className="nav-link">Trending News</a></li>
            <li className="nav-item"><a href="#live" className="nav-link">Sports Categories</a></li>
            <li className="nav-item"><a href="#polls" className="nav-link">Polls and Voting</a></li>
            <li className="nav-item"><a href="#articles" className="nav-link">Sports Article</a></li>
          </ul>
        </nav>
        <button className="search-btn">
          <i className="fa fa-search"></i> Search
        </button>
      </div>
    </header>
  );
};

export default Header;
